import React from 'react';
import { Link } from 'react-router-dom';

const Header = ({ user }) => {
    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <div className="container-fluid">
                <Link className="navbar-brand" to="/">Accueil</Link>
                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                        <li className="nav-item">
                            <div className="dropdown">
                                <button className="btn btn-outline-success dropdown-toggle" type="button" id="dropdownMenuButton" data-bs-toggle="dropdown" aria-expanded="false">
                                    Quizz
                                </button>
                                <ul className="dropdown-menu" aria-labelledby="dropdownMenuButton">
                                    <li><Link className="dropdown-item" to="/add-quiz">Ajouter un quizz</Link></li>
                                    <li><Link className="dropdown-item" to="/my-quizzes">Voir mes quizz</Link></li>
                                </ul>
                            </div>
                        </li>
                        {/* Ajoutez d'autres liens ici */}
                    </ul>
                    {user ? (
                        <div>
                            <p className="mb-0">Bienvenue, {user.firstName} {user.lastName} !</p>
                            {/* Ajoutez un lien pour se déconnecter si nécessaire */}
                        </div>
                    ) : (
                        <Link className="btn btn-outline-success" to="/login">Se connecter</Link>
                    )}
                </div>
            </div>
        </nav>
    );
};

export default Header;
